    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Mark Twain NWR for the next 15 years. This plan
    outlines the Complex vision and purpose and describes how Mark Twain NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Complex, a summary of Complex resources, information about the management direction
    and boundary expansion, and strategies for implementation. Key planning issues include:
    water management, fisheries management, forest management, recreation, wildlife,
    habitat, hunting, land acquisition, interagency partnerships, and restoration of
